def fun(nums, target):
    '''
    暴力算法，直接完全遍历，算法复杂度 O(n2),耗时约 20s
    '''
    nums_len = len(nums)

    for i in range(nums_len):
        for j in range(nums_len):
            if i != j: # 不能是同一个位置的数
                if nums[i] + nums[j] == target:
                    return([i, j])


def fun(nums, target):
    '''
    找差值法。先找到差值，然后再次遍历列表，
    直到遇到符合条件的值。算法复杂度仍然是 O(n2),耗时约13s
    '''
    nums_len = len(nums)
    for i in range(nums_len):
        n = nums[i]
        complement = target - n
        for j in range(nums_len):
            if i != j and nums[j] == complement:
                return [i, j]


def fun(nums, target):
    '''
    只遍历了一遍
    '''
    nums_len = len(nums)
    for i in range(nums_len):
        n = nums[i]
        complement = target - n
        if complement in nums:
            j = nums.index(complement)
            if j == i and complement in nums[j+1:]:
                j = nums.index(complement, j+1, nums_len)
            return [i, j]


